import React, { useState, useEffect } from "react"
import $ from "jquery"

import "./Map Page.scss"

export default function MapPage() {
    const [ img, setimg ] = useState("");

    useEffect(() => {
        $(function () {
            console.log("-------------Start-------------")
            console.log(
                localStorage.getItem("maps"),
                localStorage.getItem("current map"),

                $.ajax({
                    method: "POST",
                    url: `https://api.imgbb.com/1/upload?key=YOUR_CLIENT_API_KEY`,
                    data: { name: "John", location: "Boston" }
                })
            )
        });
    }, [0])
    
    return (
        <>
            <img src={img} alt="Map" className="map-page" />
            <nav className="map-page-party">
                <ul className="map-page-party-list">
                    <li className="map-page-party-list-item">a</li>
                    <li className="map-page-party-list-item"></li>
                    <li className="map-page-party-list-item"></li>
                </ul>
            </nav>
            <nav className="map-page-nav">
                <ul className="map-page-nav-list">
                    <li className="map-page-nav-list-item">a</li>
                    <li className="map-page-nav-list-item"></li>
                    <li className="map-page-nav-list-item"></li>
                </ul>
            </nav>
        </>
    )
}
